import React from 'react'


const DndTest = () => {
    return (
        <div>
            <header>
                <div className="drag-n-drop">
                    <div className="dnd-group">
                        <div className="dnd-item">
                            <div className="card">
                                <p>ITEM</p>
                            </div>
                        </div>
                    </div>
                </div>
            </header>
        </div>
    );
}

export default DndTest;
